import React, { Component } from 'react';
import { useState } from 'react';
import {useNavigate} from 'react-router-dom';
import '../editprofile.css';

class EditProfile extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      userName: '',
      password: '',
      height:'',
      age: '',
      gender: {value: 'Male'},
      weight: '',
      exerciseFlag: {value: 1},
    };

    this.handleInputChange = this.handleInputChange.bind(this);
  }
  handleInputChange(event) {
    const target = event.target;
    const name = target.name;

    this.setState({
      [name]: value
    });
  }

  render() {
    const navigate = useNavigate();

    const navigateToDashboard = () => {
    navigate('/dashboard');
    };

    return (
      <form>
      <html>
        <head>
          <title>
            Profile Page
          </title>
        </head>

        <body>
          <div className="App-header">
            <header>
              <p>
                Edit Profile
              </p>
            </header>
          </div>
          <div className='App-body'>
            <form>
              <div>              
                <div>Username</div>              
                <input name="userName" type="text" placeholder="username" value={this.state.userName} onChange={this.handleInputChange}/>  
              </div>
              <div>
                <div>Password</div>                              
                <input name="password" type="text" placeholder="password" value={this.state.password} onChange={this.handleInputChange}/>  
              </div>
              <div>
                <div>Height</div>                              
                <input name="height" type="number" placeholder="meters" value={this.state.height} onChange={this.handleInputChange}/>  
              </div>
              <div>
                <div>Age</div>
                <input name="age" type="number" placeholder="years" value={this.state.age} onChange={this.handleInputChange}/>  
              </div>
              <div>
                <div>Gender</div>
                <input name="gender" type="text" placeholder="gender" value={this.state.gender} onChange={this.handleInputChange}/>  
              </div>
              <div>
                <div>Weight</div>
                <input name="weight" type="number" placeholder="pounds" value={this.state.weight} onChange={this.handleInputChange}/>  
              </div>
              <div>
                <div>Exercise flag</div>            
                <input name="flag" type="text" placeholder="integer" value={this.state.flag} onChange={this.handleInputChange}/>  
              </div>
              <div className='submit'>
                <input onClick={navigateToDashboard} type="submit" value="Submit"/>
              </div>
            </form>
          </div>
        </body>
      </html>  
      </form>        
    );
  }
}
function EditProfilePage() {
  const [userName, setUserName] = React.useState('');
  const [password, setPassword] = React.useState('');
  const [height, setHeight] = React.useState('');
  const [age, setAge] = React.useState('');
  const [gender, setGender] = React.useState('');
  const [weight, setWeight] = React.useState('');
  const [flag, setFlag] = React.useState('');

  const navigate = useNavigate();

  const navigateToDashboard = () => {
  navigate('/dashboard');
  };

  function handleSubmit() {
    preventDefault();
    navigateToDashboard();
  }

  return (
    <form onSubmit={handleSubmit}>
      <html>
        <head>
          <title>
            Profile Page
          </title>
        </head>

        <body>
          <div className="App-header">
            <header>
              <p>
                Edit Profile
              </p>
            </header>
          </div>
          <div className='App-body'>
            <form>
              <div>              
                <div>Username</div>              
                <input type="text" id="userName" name="userName" value={userName} placeholder="username" onChange={(e) => setUserName(e.target.value)}/>  
              </div>
              <div>
                <div>Password</div>                              
                <input type="password" id="password" value={password} name="password" placeholder="password"/>  
              </div>
              <div>
                <div>Height</div>                              
                <input type="number" id="height" name="height" value={height} placeholder="meters"/>  
              </div>
              <div>
                <div>Age</div>
                <input type="number" id="age" name="age" value={age} placeholder="years"/>  
              </div>
              <div>
                <div>Gender</div>
                <input type="text" id="gender" name="gender" value={gender} placeholder="gender"/>  
              </div>
              <div>
                <div>Weight</div>
                <input type="text" id="weight" name="weight" value={weight} placeholder="pounds"/>  
              </div>
              <div>
                <div>Exercise flag</div>            
                <input type="number" id="flag" name="flag" value={flag} placeholder="integer"/>  
              </div>
              <div className='submit'>
                <input type="submit" value="Submit"/>
              </div>
            </form>
          </div>
        </body>
      </html>   
    </form>       
  );
}

export default EditProfilePage;
